import React, { Component } from 'react';
import "./NavBar.css";
import Grid from '@material-ui/core/Grid';
import fblogo from "../../images/logo.png";
import home from "../../images/home.svg";
import pages from "../../images/pages.svg";
import watch from "../../images/watch.svg";
import market from "../../images/market.svg";
import friends from "../../images/groups.svg";
import { Avatar } from '@material-ui/core';

class NavBar extends Component {
    constructor(props) {
        super(props);
        this.state = {  }   
    }
    render() { 
        return ( 
            <div>
                <Grid container className="parent_container">
                    <Grid item xs ={3}>
                        <div className="navbar__leftbar">
                            <img className="navbar__logo" src={fblogo} width="40px"/>
                            <input className="navbar__search" type="text" placeholder="Search Facebook" />
                        </div>
                    </Grid>
                    <Grid item xs ={6}>
                        <div className="navbar__container">
                            <div className="navbar__nav active">
                                <img className="navbar__image" src={home} />
                            </div>
                            <div className="navbar__nav">
                                <img className="navbar__image" src={pages} />
                            </div>
                            <div className="navbar__nav">
                                <img className="navbar__image" src={watch} />
                            </div>
                            <div className="navbar__nav">
                                <img className="navbar__image" src={market} />
                            </div>
                            <div className="navbar__nav">
                                <img className="navbar__image" src={friends} />
                            </div>
                        </div>
                    </Grid>
                    <Grid item xs ={3}>
                        <div>
                            <div className="navbar__right">
                                <Avatar className="navbar_rightimage" src="https://scontent.fccu3-1.fna.fbcdn.net/v/t1.6435-1/p100x100/162713656_4172696726074274_4057600099221701280_n.jpg?_nc_cat=109&ccb=1-3&_nc_sid=7206a8&_nc_ohc=3bDwi8YOtykAX-shqfn&_nc_ht=scontent.fccu3-1.fna&tp=6&oh=43721f7af36e80201b1f1b9e2cae7351&oe=608CBCEA" />
                                <div className="navbar_righttext">Anindya</div>
                            </div>
                        </div>
                    </Grid>
                </Grid>
            </div> 
        );
    }
}

export default NavBar;
